import React from "react";

export default function RequestsPage({ allRequests, address }) {
  return (
    <div className="req-list">
      <h1 className="req-heading">WITHDRAWAL REQUESTS</h1>
      {allRequests &&
        allRequests.map((request) => (
          <ul className="requests">
            {request.campaignAccount === address && (
              <li>{request.theRequest}</li>
            )}
          </ul>
        ))}
    </div>
  );
}
